CREATE TABLE `trabajadores` (
  `idTrabajadores` int NOT NULL AUTO_INCREMENT,
  `DUI` varchar(10) NOT NULL,
  `Nombre` varchar(45) NOT NULL,
  `Apellido` varchar(45) NOT NULL,
  `Celular` varchar(8) NOT NULL,
  `Direccion` varchar(120) NOT NULL,
  `Correo` varchar(100) NOT NULL,
  `Contrasena` varchar(20) NOT NULL,
  `Descripcion` varchar(250) NOT NULL,
  `Departamento` int NOT NULL,
  `Municipio` int NOT NULL,
  `Genero` varchar(45) NOT NULL,
  `Foto` longblob,
  `Aceptado` int NOT NULL DEFAULT '0',
  `Membresia` int DEFAULT NULL,
  `trabajos` int DEFAULT '0',
  `fechaDeEntrada` date DEFAULT NULL,
  PRIMARY KEY (`idTrabajadores`),
  KEY `Membresia_idx` (`Membresia`),
  KEY `Municipiotrabajador_idx` (`Municipio`),
  KEY `DepartamentoTrabajador_idx` (`Departamento`),
  CONSTRAINT `DepartamentoTrabajador` FOREIGN KEY (`Departamento`) REFERENCES `departamentos` (`idDepartamento`),
  CONSTRAINT `Membresia` FOREIGN KEY (`Membresia`) REFERENCES `membresias` (`idMembresias`),
